	<template>
		<style type="text/css">:host{
	font-family: Verdana, Geneva, sans-serif;
	font-size: 11px;
}

h1{
	font-size: 28px;
	font-weight: normal;
	margin: 0;
	padding: 20px 0;
	font-family: GeomSlab703W01-Medium;
}
.column{
	min-width: 300px;
	width: 30%
}
paper-shadow{
	margin: 20px;
	color: #E56500;
}

.core-selected{
	background-color: #E56500;
	color:white;
}

.core-selected .icon{
	background-color: #E56500;
}

.core-selected .icon core-icon{
	fill: white;
	color: white;
}


.hidden{
	display: none;
}


.icon{
	background-color: white;
	padding: 10px;
}

.icon core-icon{
	fill: #E56500;
	color: #E56500;
	width: 25px;
	height: 25px;
}

.account-name{
	font-size: 1.2em;
	font-weight: bold;
}

input, textarea{
	border: 1px solid #c9c9c9;
	height: 50px;
	padding: 0 12px;
	font-size: 18px;
	line-height: 27px;
	color: #999;
	background: #fff;
	display: block;
	width: 100%;
	box-sizing :border-box;
}

input:focus,
select:focus,
textarea:focus,
button:focus {
    outline: none;
}

input:disabled, textarea:disabled{
	border: 1px solid #E6E6E6;
}

input.error{
	border: 1px solid #c33;
}

div.error{
	color: #c33;
	font-size: 12px;
	padding: 5px;
}

form .form-field{
	margin-bottom: 20px;
}

form .form-field.loading-icon{
	text-align: center;
}

textarea {
	height: 120px;
}

.link-btn{
	border: 1px solid #C9C9C9;
	font-size: 24px;
	padding: 5px;
	display: block;
	text-decoration: none;
	color: #4E4E4E;
	text-align: center;
	width: 100%;
	box-sizing :border-box;
	padding: 10px;
}

#continue{
	background-color: #E56500;
	color: white;
}

#continue:disabled{
	background-color: #F2B280;
}

#cancel
{
	background-color: white;
	border: 1px solid #C9C9C9;
	font-size: 16px;
	padding: 14px;
}

#cancel:disabled{
	border: 1px solid #E6E6E6;
}

		<ing-data-products id="dataProducts" fromaccounts="{{fromaccounts}}" products="{{products}}"></ing-data-products>
		<ing-data-accounts id="dataAccounts" accounts="{{allaccounts}}"></ing-data-accounts>
		<h1>Move Money</h1>
		<div layout="" horizontal="" wrap="">
			<div flex="" id="from" class="column">
				<span>From</span>
				<div vertical="" center-justified="" layout="">
					<core-selector id="fromSelector" selected="{{selectedfromaccountindex}}">
					<template repeat="{{account, ind in computedaccounts}}">
					<paper-shadow z="2">
					<div flex="" aria-label="{{markIfSelected(ind, selectedfromaccountindex)}}from account: {{account.AccountNumber}} balance: {{transformBalanceForAria(account.Balance)}}">
						<div layout="" horizontal="" center="" style="padding:10px">
							<div class="icon">
								<core-icon id="icon" icon="ing:heart">
								</core-icon>
							</div>

							<div>
								<div>
									<span class="account-name">{{account.AccountNameDisplay}}</span>
								</div>
								<div>
									<span class="account-number">{{account.AccountNumber}}</span>
								</div>
								<div>
									<span class="account-balance">{{account.Balance | money | addCurrencySymbol}}</span>
								</div>
							</div>
						</div>
						
					</div>
					</paper-shadow>
					</template>
					</core-selector>
					<div on-click="{{clearFromSelection}}">clear</div>
				</div>
			</div>
			<div id="to" flex="" class="column">
				<span>To</span>
				<div vertical="" center-justified="" layout="">
					<core-selector id="toSelector" selected="{{selectedtoaccountindex}}">
					<template repeat="{{account, ind in toaccounts}}">
					<paper-shadow z="2">
					<div flex="" aria-label="{{markIfSelected(ind, selectedtoaccountindex)}}to account: {{account.CustomerAccount.AccountNumber}} balance: {{transformBalanceForAria(getAccountBalance(account))}}" on-click="{{finaliseSelection}}">
						<div layout="" horizontal="" center="" style="padding:10px">
							<div class="icon">
								<core-icon id="Core-icon1" icon="ing:heart"></core-icon>
							</div>
							<div>
								<div>
									<span class="account-name">{{account.AccountNameDisplay}}</span>
								</div>
								<div>
									<span class="account-number">{{account.CustomerAccount.AccountNumber}}</span>
								</div>
								<div>
									<span class="account-balance">{{getAccountBalance(account) | money | addCurrencySymbol}}</span>
								</div>
							</div>
						</div>
					</div>
					</paper-shadow>
					</template>
					</core-selector>
				</div>
			</div>
			<div flex="" id="details" class="column">
				<form action="">
					<div class="form-field">
						<input type="text" id="amount" aria-labelledby="amount" placeholder="Amount" value="{{amount}}" disabled?="{{ validation.model.$amount.disabled }}">
						<template bind="" if="{{ validation.model.$amount.hasError }}">
						<div class="error">Please provide an amount in the correct format: xxx.xx</div>
						</template>
					</div>
					<div class="form-field">
						<textarea id="message" aria-labelledby="Message" placeholder="Message" value="{{message}}" disabled?="{{ validation.model.$message.disabled }}"></textarea>
					</div>
					<div class="{{validation.model.isProcessing ? 'hidden' : ''}}">
						<div class="form-field">
							<button id="continue" aria-labelledby="Continue" class="link-btn" on-click="{{moveMoney}}" disabled?="{{ validation.model.$continue.disabled }}">Continue</button>
						</div>
						<div class="form-field">
							<button id="cancel" class="link-btn">Cancel transaction</button>
						</div>
					</div>
					<div class="{{validation.model.isProcessing ? '' : 'hidden'}}">
						<div class="form-field loading-icon">
							<img src="button-loading-dark.gif">
						</div>
					</div>
				
			</form></div>
		</div>
	</template>
	
</polymer-element></div>
	<ing-session></ing-session>
	<ing-repo-accounts-au></ing-repo-accounts-au>
	<ing-repo-move-money-au></ing-repo-move-money-au>
	<ing-bootstrapper dependencies="['ing-repo-accounts-au', 'ing-repo-move-money-au']"></ing-bootstrapper>

	<test-ui-launcher></test-ui-launcher>

	<polymer-element name="test-ui-launcher" assetpath="">
		<template>
			<core-signals on-core-signal-bootstrap-done="{{handlerBootstrapDone}}"></core-signals>
			<div id="placeholder"></div>
		</template>
		
	</polymer-element>

	<script src="vulcanized.js"></script></body></html>
